import React from 'react';
import ProductList from './ProductList'; // Таблиця зі списком продуктів
import ProductForm from './ProductForm'; // Форма для додавання/редагування продуктів

const AdminProductsPage = () => {
  return (
    <div>
      <h1 className="text-2xl font-bold mb-4">Управління продуктами</h1>
      <ProductForm /> {/* Компонент форми */}
      <ProductList /> {/* Компонент списку */}
    </div>
  );
};

export default AdminProductsPage;
